export default function MenTShirtsScreen() {
    
    
    return (

        <div>
            <div className="row center">
  {MenTshirtsData.Tshirt.map((product)=>
   <MenTshirts key = {product._id} product ={product}></MenTshirts>
  )
  }
 </div>
        </div>
    )
}
